syntax = "proto3";
package msg;

message Login {
    string name = 1;
    string uid = 2;
    string photoUrl = 3;
}

message ZiJieLogin {
    string appid = 1;
    string secret = 2;
    string LoginCode = 3; //客户端login接口返回的登录凭证
    int32 platform = 4;  // 0-抖音平台，1-微信平台
}

message ZiJieLoginResult {
    string openid = 1;
}
